import React, { useEffect } from 'react';
import './App.css';
import { buttonon } from './nav';

function App() {
  // Function to call buttonon() when the component mounts
  useEffect(() => {
    buttonon();
  }, []);

  return (
    <div>
      <div id="navb" className="navb">
        <a href="" id="colum1" className="colum"></a>
        <a
          href="https://m3.material.io/styles/icons/overview"
          id="colum2"
          className="colum"
          style={{ backgroundColor: 'bisque' }}
        >
          <h3> &#160 &#160 &#160 ART</h3>
        </a>
        <a href="# " id="colum3" className="colum" style={{ backgroundColor: 'rebeccapurple' }}></a>
      </div>
      <button id="menubtn" className="custom-button">
        <i id="icon" className="bi-check-circle"></i>
      </button>
    </div>
  );
}

export default App;
